const sidebar_arrow = document.querySelector(".sidebar-arrow");
const sidebar = document.querySelector(".sidebar");
const sidebar_text = document.querySelector(
  ".subsidebar-one p span:nth-child(1)"
);
const subsidebar_list = document.querySelector(".subsidebar-two ul");

export function journeyBoard() {
  if (isOpen) {
    sidebar.style.width = "132px";
    sidebar_arrow.style.transform = `rotate(0deg)`;
    sidebar_text.style.opacity = 0;
    subsidebar_list.style.display = "none";
    isOpen = false;
  } else {
    sidebar.style.width = "392px";
    sidebar_text.style.opacity = 1;
    sidebar_arrow.style.transform = `rotate(-180deg)`;
    subsidebar_list.style.display = "block";
    isOpen = true;
  }
}
